from functools import cache

# brute force
class NumMatrix2:
    
    def __init__(self, matrix: list[list[int]]):
        self.matrix = matrix


    @cache    
    def sumRegion(self, row1: int, col1: int, row2: int, col2: int) -> int:

        if row1 == row2:
            return sum(self.matrix[row1][col1:col2+1])

        su = 0
        for row in range(row1, row2+1):
            su += self.sumRegion(row, col1, row, col2)
        return su


# row cache
class NumMatrix3:
    
    def __init__(self, matrix: list[list[int]]):
        self.matrix = matrix
        self.rows = []
        for r in range(len(matrix)):
            self.rows.append([matrix[r][0]])
            for c in range(1, len(matrix[0])):
                self.rows[r].append(self.rows[r][c-1] + matrix[r][c])
        #print(self.matrix)
        #print(self.rows)


    @cache
    def sumRow(self, row, col1, col2):
        if col1 == col2:
            return self.matrix[row][col1]
        elif col1 >= 1:
            return self.rows[row][col2] - self.rows[row][col1-1]
        else:
            return self.rows[row][col2]


    def sumRegion(self, row1: int, col1: int, row2: int, col2: int) -> int:

        su = 0
        for row in range(row1, row2+1):
            su += self.sumRow(row, col1, col2)
        return su


# box cache
class NumMatrix:
    
    def __init__(self, matrix: list[list[int]]):
        ca = [[0] * (len(matrix[0])+1) for _ in range(len(matrix)+1)]
        for i in range(len(matrix)):
            for j in range(len(matrix[0])):
                ca[i+1][j+1] = ca[i+1][j] + ca[i][j+1] - ca[i][j] + matrix[i][j]
        self.ca = ca


    def sumRegion(self, row1: int, col1: int, row2: int, col2: int) -> int:
        return self.ca[row2+1][col2+1] - self.ca[row1][col2+1] - self.ca[row2+1][col1] + self.ca[row1][col1]


